def palindrome_of_length_n(s):
    s = s.upper()
    palindromes = set()

    for i in range(len(s)):
        for j in range(i + 173, min(i + 173 + 1, len(s) + 1)):
            substring = s[i:j]
            if substring == substring[::-1] and substring.isalpha():
                palindromes.add(substring)

    return palindromes
